('storage_layout_tool_description', 'global', 'This module allows users to view or create the storage layout infrastructure.<br><br> The storage layout is defined by the creation of storage entities (as ''Box'', ''Room'', etc) and the definition of the storage entities positions into the parent storage entities.<br>', 'Ce module permet aux utilisateurs de visualiser ou cr&eacute;er l''infrastructure de l''entreposage. <br><br>L''infrastructure de l''entreposage est d&eacute;finie par la cr&eacute;ation d''entit&eacute;s d''entreposage (comme des ''pi&egrave;ces'', des ''Bo&icirc;tes'', etc) et la d&eacute;fintion des positions de ces entit&eacute;s dans des entit&eacute;s d''entreposage ''parents''. <br>'),
('storage_layout_tool_title', 'global', 'Description', 'Description'),
('storage_temp', 'global', 'Storage Temperature', 'Storage Temperature'),
('storages position definition help', 'global', 'Here is the list of existing storage types plus their coordinates defintion used to define postion of an entity (storage, aliquot, etc) into this one:<ul>\r\n<li> Room (no coordinates to set). \r\n<li> Nitrogen Container (no coordinate to set).  \r\n<li> Incubator:<ul> \r\n<li> First coordinate: ''shelf'' with undefined type.\r\n</ul>\r\n<li> Fridge:<ul> \r\n<li> First coordinate: ''shelf'' with undefined type.\r\n</ul>\r\n<li> Freezer (no coordinate to set).  \r\n<li> Shelf:<ul> \r\n<li> First coordinate: ''tray'' with undefined type.\r\n</ul>\r\n<li> Box (no coordinate to set).  \r\n<li> Box81 A1-I9:<ul> \r\n<li> First coordinate: ''column'' alphabetical value from A to I.\r\n<li> Second coordinate: ''row'' integer value from 1 to 9.\r\n</ul>\r\n<li> Box81 1-81:<ul> \r\n<li> First coordinate: ''position'' integer value from 1 to 81.\r\n</ul>\r\n<li> Rack16:<ul> \r\n<li> First coordinate: ''column'' alphabetical value from A to D.\r\n<li> Second coordinate: ''row'' integer value from 1 to 4.\r\n</ul>\r\n<li> Rack10:<ul> \r\n<li> First coordinate: ''position'' integer value from 1 to 10.\r\n</ul> \r\n<li> Rack24:<ul> \r\n<li> First coordinate: ''position'' integer value from 1 to 24.\r\n</ul> \r\n</ul>', 'Cette liste contient les diff&eacut;rents types d''entreposage ainsi que la dÃ©fintion de leurs coordonn&eacute;es utilis&eacute;es pour d&eacute;terminer la position d''une entit&eacute;e (entreposage, aliquots) dans ce dernier:<ul>\r\n<li> Pi&egrave;ce (aucune coordonn&eacute;e &agrave; d&eacute;finit). \r\n<li> R&eacute;servoir d''azote liquide (aucune coordonn&eacute;e &agrave; d&eacute;finit).   \r\n<li> Incubateur:<ul> \r\n<li> 1st coordonn&eacute;e: ''&Eacute;tag&egrave;re'' de type inconnu.\r\n</ul>\r\n<li> Frigo:<ul> \r\n<li> 1st coordonn&eacute;e: ''&Eacute;tag&egrave;re'' de type inconnu.\r\n</ul>\r\n<li> Cong&eacute;lateur (aucune coordonn&eacute;e &agrave; d&eacute;finit). \r\n<li> &Eacute;tag&egrave;re: