INSERT INTO `sop_masters` (`id`, `title`, `notes`, `code`, `version`, `sop_group`, `type`, `status`, `expiry_date`, `activated_date`, `scope`, `purpose`, `detail_tablename`, `detail_form_alias`, `extend_tablename`, `extend_form_alias`, `created`, `created_by`, `modified`, `modified_by`, `form_id`) VALUES (1, 'Database Transmission to CTRNet Database', '', '3.1.003', '26', 'General', 'All', '', '0000-00-00', '0000-00-00', 'This standard operating procedure (SOP) outlines general elements and features that should be in place to ensure that information transmission is done in a manner that safeguards data integrity and protects the participant''s privacy and security.\r\n', 'Tumour banks or repositories are intended to manage the safekeeping of clinical data and other sample associated data in their custody. When data transmission is required, it must be done in a manner that protects the participant''s privacy and ensures that none of the data is modified or lost.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, '2008-08-26 00:41:22', '1', NULL),
(2, 'Immunization and Personnel Accident Reports', '', '6.1.003', '30', 'General', 'All', '', NULL, NULL, 'The Occupational Health and Safety Procedures at the institution hosting the biorepository will have procedures that should form the basis of safety precautions and actions personnel should follow. However, this procedure covers basic steps that should be followed to ensure that personnel are adequately immunized and accidents are appropriately reported and documented.\r\n', 'All human specimens, independent of their state, should be treated with universal precautions. They should be handled as if infected with agents that may be pathogenic to humans. Precautions should be taken to safeguard personnel from potential infectious hazards. They should have up-to-date immunizations and report and document all accidents that they may be involved with at the biorepository.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(3, 'Biohazardous Material Waste Management', '', '8.1.002', '8', 'General', 'All', '', NULL, NULL, 'This standard operating procedure (SOP) outlines processes that must be followed in order to dispose of biohazardous waste in a manner compliant to safety regulations and ensuring that the following risks are minimized: · Contamination of public waste sites with biohazardous materials.      · Exposure of repository and waste management personnel to infectious agents.\r\n', 'All Human Biological Materials (HBMs) whether fixed, lyophilized, fresh, frozen or paraffin embedded should be considered biohazardous. The degree of processing may reduce the risk from infective agents.  However, certain agents may still be infective even when fixed or processed.  All human specimens, independent of their state, should be treated with universal precautions. They should be handled as if infected with agents that may be pathogenic to humans.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(4, 'Retention of Data for Unbankable Samples', '', '2.1.005', '', 'General', 'All', '', NULL, NULL, '', '', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(6, 'Tissue Derivatives: Extraction of RNA', '', '8.3.011', '', 'General', 'All', '', NULL, NULL, 'The Standard Operating Procedure (SOP) describes how RNA should be extracted from snap frozen tissue and tissue frozen in OCT. The SOP does not cover detailed safety procedures for handling Human Biological Materials (HBMs) or hazardous chemicals and it is recommended that personnel follow institutional safety guidelines.  \r\n', 'Tissue samples are collected from patients that have been through the informed consent process and agreed to participate in the tumour repository program. Genomic studies often utilize nucleic acids (DNA and RNA) derived from these samples. When extracting and storing RNA from tissue specimens all efforts should be made to avoid contamination, prevent degradation and preserve molecular integrity. The purpose of this document is to outline standardized procedures for CTRNet repositories to follow when extracting RNA from tissue samples.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(7, 'Destruction of Human Specimen Material', '', '8.1.004', '', 'General', 'All', '', NULL, NULL, 'The SOP covers what should be done to dispose of human biological material that has to be eliminated from the repository collection.  These steps may be adopted as is, or modified by specific CTRNet member repositories at their collection sites to allow for the incorporation of site-specific details, conditions and REB requirements.\r\n', 'There are situations such as inadequate consent, revoked consent or storage equipment failure where it becomes necessary to dispose of human biological material. Under these conditions, all unprocessed material must be destroyed or disposed under conditions that incorporate safety considerations and respect the rights of the participant that the material was derived from.   \r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(9, 'Sample Retrieval', '', '8.3.013', '', 'General', 'All', '', NULL, NULL, NULL, NULL, 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(10, 'Blood Collection', '', '8.2.001', '', 'General', 'All', '', NULL, NULL, 'The Standard Operating Procedure (SOP) describes how blood should be drawn.   The SOP does not cover detailed safety procedures for handling blood and personnel must follow institutional bio-safety guidelines. \r\n', 'Blood samples are drawn from patients that have been through the informed consent process and agreed to participate in the tumour repository program. Blood samples are obtained by personnel qualified to draw blood from patients in the cancer centre, the hospital or in the physician’s office. The purpose of this document is to outline standardized procedures for CTRNet repositories to follow for blood collection.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(11, 'Creating Derivatives: DNA Extraction from Blood Sa', '', '8.2.004', '5', 'General', 'All', '', NULL, NULL, 'The Standard Operating Procedure (SOP) describes how DNA should be extracted from blood samples. The SOP does not cover detailed safety procedures for handling Human Biological Materials (HBMs) or hazardous chemicals and it is recommended that personnel follow institutional safety guidelines.  \r\n', 'Tissue samples are collected from patients that have been through the informed consent process and agreed to participate in the tumour repository program. Genomic studies often utilize nucleic acids (DNA and RNA) derived from these samples. When extracting and storing DNA from blood samples all efforts should be made to avoid contamination, prevent degradation and preserve molecular integrity. The purpose of this document is to outline standardized procedures for CTRNet repositories to follow when extracting DNA from blood samples.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(12, 'Collection of tumour tissue and transportation fro', '', '8.3.001', '16', 'General', 'All', '', NULL, NULL, 'The Standard Operating Procedure (SOP) describes how tissues should be collected and transported. The SOP does not cover detailed safety procedures for handling Human Biological Materials (HBMs) and it is recommended that personnel follow institutional biosafety guidelines.  \r\n', 'The purpose of this document is to outline standardized procedures for CTRNet repositories to follow during the process of tumour tissue collection and transportation from the operating room (OR) to the pathology lab. Tissue samples are collected from patients that have given their consent to participate in the tumour repository program only if there is tissue in excess to that required for pathological assessment and diagnosis. \r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(13, 'Labelling and Tracking Materials', '', '8.1.001', '', 'General', 'All', '', NULL, NULL, 'The Standard Operating Procedure (SOP) describes how samples are labelled and tracked. \r\n', 'The purpose of this CTRNet Standard Operating Procedure (SOP) is to outline general procedures that can be used by repositories to ensure that labelling and tracking are maintained with essential standards to prevent loss of samples due to inadequate identifying information.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(14, 'Tissue Harvesting', '', '8.3.002', '', 'General', 'All', '', NULL, NULL, 'The Standard Operating Procedure (SOP) describes how tissues should be harvested. The SOP does not cover detailed safety procedures for handling Human Biological Materials (HBMs) and it is recommended that personnel follow institutional biosafety guidelines.  \r\n', 'Tissue samples are collected from patients that have been through the informed consent process and agreed to participate in the tumour repository program. Tumour tissues are obtained by personnel qualified by training to do so and are collected for the tumour bank only if present in excess to that required for pathological assessment and diagnosis. The purpose of this document is to outline standardized procedures for CTRNet repositories to follow during tumour tissue harvesting.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(15, 'Freezing of Tissue in OCT', '', '8.3.004', '', 'General', 'All', '', NULL, NULL, 'The Standard Operating Procedure (SOP) describes how tissues are frozen in OCT. The SOP does not cover detailed safety procedures for handling Human Biological Materials (HBMs) or hazardous chemicals and it is recommended that personnel follow institutional safety guidelines.  \r\n', 'Tissue (surplus to the needs of pathology) samples are collected from patients that have been through the informed consent process and agreed to participate in the tumour repository program. Fresh frozen tissue collections are a valuable resource for research purposes. Tumour tissues are only suitable for proteomic and genomic studies if cryopreserved in a timely and appropriate manner. OCT is a compound especially good for preserving cellular ultrastucture (histology) and likely nucleic acids as well. The purpose of this document is to outline standardized procedures for CTRNet repositories to follow during freezing tissue in OCT.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(17, 'Preservation of Tissue: Paraffin Embedding', '', '8.3.005', '', 'General', 'All', '', NULL, NULL, 'The Standard Operating Procedure (SOP) describes how tissues should be preserved by FFPE. The SOP does not cover detailed safety procedures for handling Human Biological Materials (HBMs) or hazardous chemicals and it is recommended that personnel follow institutional safety guidelines.  \r\n', 'Tumour tissues are only suitable for specific research studies if preserved appropriately. To date, formaldehyde is the most widely used universal fixative because it preserves a wide range of tissues and tissue components.  Formaldehyde fixed and paraffin embedded (FFPE) tissue can easily be stored under normal laboratory conditions for a long period of time. The method is effective for preserving histological morphology of the tissue specimen. The purpose of this document is to outline standardized procedures for CTRNet repositories to follow when preserving tissue by the FFPE method.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(18, 'Sectioning of Paraffin and OCT Embedded Tissue', '', '8.3.007', '', 'General', 'All', '', NULL, NULL, 'The Standard Operating Procedure (SOP) describes how tissues preserved in paraffin and OCT should be sectioned. The SOP also outlines minimum assessent that should be in place to evaluate the quality and integrity of paraffin and frozen tissue sections. The SOP does not cover detailed safety procedures for handling Human Biological Materials (HBMs) or hazardous chemicals and it is recommended that personnel follow institutional safety guidelines\r\n', 'Preserved tumour tissues collected through the informed consent process are  valuable for specific research studies. Formaldehyde fixed and paraffin embedded (FFPE) tissue and tissue frozen in OCT can be sectioned for studies needing preservation of histo-morphology of the specimen. For studies involving immunohistochemistry (IHC) or in situ hybridization (ISH), sections of unfixed tissue frozen in OCT may be more appropriate. Some research studies also use sections to extract nucleic acids from specimens. The purpose of this document is to outline standardized procedures for CTRNet repositories to follow when sectioning tissue preserved in paraffin or OCT. In addition, quality control is fundamental to the successful operation to a tissue bank offering tissue specimens for research purposes. CTRNet repositories should be confident that they are providing tissue sections with high quality to appropriately meet the research needs of the investigators. Testing procedures should be in place to monitor and assess the quality and integrity of the sections released for prospective research studies. \r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(19, 'TMAs from Paraffin Embedded Tissue Blocks', '', '8.3.012', '5', 'General', 'All', NULL, NULL, NULL, 'The Standard Operating Procedure (SOP) describes how TMAs should be constructed from FFPE tissue blocks. The SOP does not cover detailed safety procedures for handling Human Biological Materials (HBMs) or hazardous chemicals and it is recommended that personnel follow institutional safety guidelines.  \r\n', 'Formaldehyde fixed and paraffin embedded (FFPE) tissue can be sectioned for studies needing preservation of histo-morphology. Conservation of the tissue resource is important to maximize the number of studies that can be conducted. Tissue Micro Arrays (TMAs) provide a cost-effective and efficient method of conserving tissue samples. They have been used for molecular and immunohistochemical studies and are a valuable tool for evaluation of patient material. The purpose of this document is to outline standardized procedures for CTRNet repositories to follow when creating TMAs from paraffin embedded tissue blocks.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(20, 'Inventory Verification', '', '8.1.004', '', 'General', 'All', NULL, NULL, NULL, 'The SOP covers the procedures for inventory verification. It outlines process validation steps to be followed to check that the correct storage  locations have been entered in the computerized inventory system.. These steps may be adopted as is, or modified by specific CTRNet member repositories at their collection sites to allow for the incorporation of site-specific details, conditions,  requirements and features of their informatics system.\r\n', 'In operating a tumour tissue repository there is a responsibility to maintain and operate the bank to safeguard the collection. The use of an informatics system for documenting and tracking the collection is crucial. A database developed specifically for documenting and storing sample information will be part of the informatics system. As part of the Quality Assurance system, inventory verification should is conducted to confirm that the appropriate specimens are in the correct freezer locations.    \r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(21, 'Procedure for Back-up Power', '', '4.1.003', '', 'General', 'All', NULL, NULL, NULL, 'This standard operating procedure (SOP) outlines elements and processes that should be in place to ensure that equipment that requires uninterrupted power supply is switched to back-up power.\r\n', 'Tumour banks or repositories are intended to store and manage the Human Biological Materials (HBMs) in their custody. Much of the equipment in the Tumour Bank is dependent on uninterrupted electrical power supply to maintain specimen integrity. In the event of a regular power supply failure, back-up power should be available. This SOP is intended to outline processes that should be in place to facilitate switching to back-up power supply.   \r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(22, 'Job Descriptions, Roles and Responsibilities', '', '0.0.102', '', 'General', 'All', NULL, NULL, NULL, 'The procedures apply to all roles at the tumour bank.', 'Personnel are an important part of a tumour repository. Descriptions of roles and responsibilities are important for selecting, hiring and supervising qualified individuals. Tumour bank personnel are encouraged to participate in the banking process in accordance with their professional roles and responsibilities.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(23, 'Handling Participant (Donor) Complaints', '', '1.1.004', '', 'General', 'All', NULL, NULL, NULL, 'The SOP covers handling of participant complaints. This SOP covers steps that should be followed when complaints are received formally or informally from participants in the tumour bank program. These steps may be adopted as is, or modified by specific CTRNet member repositories to allow for differences in local and provincial laws and regulations protecting patient rights and privacy of information.\r\n', 'Voluntary participation of patients will influence the success of the banking program. Participants must be assured that their interests and privacy is of primary importance to the management and employees of the bank. If participants have any reason to believe that their rights or interests have been violated a procedure must be in place to deal with their complaints.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(24, 'Participant Recruitment into Tumour Bank Program', '', '2.1.001', '', 'General', 'All', NULL, NULL, NULL, 'The SOP covers the procedures for identifying and recruiting patients in the tumor repository program. Consent may be obtained either prospectively or \r\n', 'The value of the collection is proportional to the number, diversity and quality  of the tissue samples banked in the program. Voluntary participation of patients will influence the success of the banking program. To promote participation, tumour bank personnel and associated clinical professionals at the participating institutions must ensure that appropriate patients are identified, approached and ethically recruited to participate in the banking initiative.  \r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(25, 'Notification of Significant and Relevant Findings', '', '2.1.007', '', 'General', 'All', '', '0000-00-00', '0000-00-00', 'The SOP covers the procedures for handling disclosure of significant and relevant research study findings to the tumour bank participant. These steps may be adopted as is, or modified by specific CTRNet member repositories at their collection sites to allow for the incorporation of site-specific details, local laws and regulations, conditions and REB requirements. \r\n', 'Tissue donated to the tumour bank is intended for research studies. Sometimes the research may yield significant data that could be relevant to the participant''s treatment, outcome, well-being or future health. Some provinces require that patients be informed of such findings. However, there are many social and ethical considerations attached to disclosure of research findings directly to the patient. Communication needs to be handled in a sensitive, professional and secure manner. This SOP is intended to outline basic steps that need to be followed if such a situation arises.      \r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, '2008-08-26 00:32:12', '1', NULL),
(27, 'Retention of Data for Unbankable Samples', '', '3.1.005', '', 'General', 'All', NULL, NULL, NULL, 'The SOP covers what should be done to participant data once the sample is considered unbankable for whatever reason under two scenarios:  (1)   The materials has not been processed into derivative products (2)   The material has been processed into derivative products and/or has been released to researchers. These steps may be adopted as is, or modified by specific CTRNet member repositories at their collection sites to allow for the incorporation of site-specific details, conditions and REB requirements provided none of the changes alter the spirit of the SOP or result in a reduced regard of the informed consent process or enforcement of privacy protection .\r\n', 'The purpose of this procedure is to ensure that when the samples have been deemed unbankable, the participant rights and privacy are protected. A sample is deemed unbankable when a consent has been has not been obtained within the prescribed period or consent has been deemed invalid (ex. Withdrawn, or invalidated by the REB). Under these conditions all identifying data and associated clinical data must be deleted from the tumour bank inventory or informatics system.  \r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(28, 'Physical Security at Tumour Bank Facilities', '', '4.1.001', '', 'General', 'All', NULL, NULL, NULL, 'This standard operating procedure (SOP) outlines general elements and features that should be in place to provide a safe and efficient environment for the repository employees. It also covers physical security of the material (tissue and information) stored in the repository\r\n', 'Tumour banks or repositories are intended to manage the safekeeping of Human Biological Materials (HBMs) in their custody. HBMs are a precious and delicate resource and each repository should use basic security systems to provide a protective environment for the resource they control.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(29, 'Handling Hazardous Chemical Waste', '', '6.1.002', '', 'General', 'All', NULL, NULL, NULL, 'The Occupational Health and Safety Procedures at the institution hosting the biorepository will have procedures that should form the basis of safety precautions for chemical handling and disposal. However, this procedure covers basic steps that should be followed to ensure that personnel are adequately informed to avoid contamination, damage to the environment and personal injury. These procedures in this SOP apply to all chemical waste at the repository.  \r\n', 'Processing and storage of Human Biological Material could involve the use of  hazardous chemicals. Measures and precautions should be taken to ensure that  personnel handle these chemicals with care to avoid contamination and injury. Disposal of used chemicals should be done safely and with adherence to local regulations.   \r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(31, 'Administration of Standard Operating Procedures (S', '', '1.1.005', '', 'General', 'All', NULL, NULL, NULL, 'This SOP describes the processes for the development, review, approval and maintenance of all CTRNet written SOPs. It applies to all tumour repository personnel involved in writing, revising, reviewing, approving and maintaining SOPs.\r\n', 'Standard Operating Procedures (SOPs) are detailed written descriptions of how to execute a particular procedure or method.  SOPs are based on national and international guidelines and conventions as well as policies and procedures that are considered “best practice” for the Canadian Tumour Repository Network (CTRNet) member repositories. The purpose of having documented SOPs is to: o     Provide written guidelines for aspects of the CTRNet tumour repository program o     Promote quality and consistency in tissue banking and data collection across the CTRNet member repositories o     Ensure compliance with applicable regulations and guidelines o     Facilitate education and training of repository personnel\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(32, 'Developing and Revising Consent Forms', '', '2.1.003', '', 'General', 'All', NULL, NULL, NULL, 'The SOP covers the procedures for developing and revising consent forms. The SOP covers basic elements of the consent form, preferred legal and cultural language that should be used, REB approval considerations and procedures for developing, reviewing and revising a consent form. These steps may be adopted as is, or modified by specific CTRNet member repositories at their collection sites to allow for the incorporation of site-specific details, conditions and requirements.\r\n', 'Obtaining voluntary consent of participants who have been informed about all the relevant aspects of the program is important for the ethical conduct of the tumour repository program. Participants consent to donate tissue (surplus to the needs of the pathology department to the tumor repository)  and allow access to their clinical records for future research They acknowledge that they understand all aspects of the program and accept associated risks if any. The consent form is an important document in the tissue banking process. It should be developed and revised to comply with current international guidelines, local laws and  have Research Ethics Board (REB) approval.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(33, 'Requesting Additional Survey Information', '', '2.1.004', '', 'General', 'All', NULL, NULL, NULL, 'This SOP covers the procedures that should be in place within the repository to request additional information from the participant or to ethically obtain this from participant medical records if possible. These steps may be adopted as is, or modified by specific CTRNet member repositories at their collection sites to allow for the incorporation of site-specific details, conditions and requirements.\r\n', 'Participants consent to donate tissue (surplus to the needs of the pathology department to the tumour repository) and allow access to their clinical records for future research. The specifics of future research are often not known at the time of consent. Research is shifting towards molecular profiling and the ability to correlate this with longitudinal clinical data, demographic data, lifestyle factors, environmental and occupational exposure, patient medical history and clinical outcomes adds enormous value to the research. Often, such information has not been collected at the time of specimen banking. Should it be deemed valuable to obtain this information, there should be procedures in place to do so.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(34, 'Withdrawal of Consent', '', '2.1.005', '', 'General', 'All', NULL, NULL, NULL, 'The SOP covers what should be done once the request for withdrawal has been received by the repository. These steps may be adopted as is, or modified by specific CTRNet member repositories at their collection sites to allow for the incorporation of site-specific details, conditions and REB requirements provided none of the changes alter the spirit of the SOP or result in a reduction the protection of the rights of the participant.\r\n', 'Participation in the tumour bank program is totally voluntary. Patients go through the informed consent process and as part of the process, participants are informed that they can withdraw consent at any time. If at any time, patients have social, philosophical, religious or family concerns they may decide to withdraw consent.  The purpose of this Standard Operating Procedure (SOP) is to outline the general procedures that should be undertaken to deal with this situation so as to uphold the rights of the participant when consent for the participant is withdrawn.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(35, 'Information Access Control', '', '3.1.001', '', 'General', 'All', NULL, NULL, NULL, 'This standard operating procedure (SOP) outlines general elements and features that should be in place to ensure that access to participant and sample information is controlled so as to limit access to authorized personnel only.\r\n', 'Tumour banks or repositories are intended to manage the safekeeping of clinical data and other sample associated data their custody. CTRNet banks are accountable for limiting disclose of information, maintaining privacy of the participants and safeguarding the integrity of the information. CTRNet has policies regarding protection of data and personal information.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL),
(36, 'Database Backup Systems', '', '3.1.002', '', 'General', 'All', NULL, NULL, NULL, 'This standard operating procedure (SOP) outlines general elements and features that should be in place to ensure that information stored on its database can be recovered accurately, completely and in a timely manner.\r\n', 'Tumour banks or repositories are intended to manage the safekeeping of clinical data and other sample associated data in their custody. CTRNet has policies regarding security safeguards to protect data and personal information stored on its database against failure, loss and damage. Failure may occur due to user error (modifying or destroying the data on its own or through a user choice), media failure (failure of equipment such hard drive) or a catastrophic event such as a fire, flood, power outage, virus, or deliberate hacking. Back up systems must ensure that the information on the database can be completely and accurately recovered. CTRNet recommends banks strive to ensure data can be fully recovered on a daily basis. The aim is to limit data loss to no more than one day.\r\n', 'sopd_general_all', 'sopd_general_all', 'sope_general_all', 'sope_general_all', NULL, NULL, NULL, NULL, NULL);
